import React from 'react';

export default function StudentNotice() {
  return (
    <div style={{ marginLeft: '51px', marginRight: '256px', marginTop: '28px', marginBottom: '60px' }}>
      <p style={{ fontfamily: 'Roboto', fontStyle: 'normal', fontWeight: 'normal', fontSize: '18px', lineHeight: '21px', color: '#4D4D4D' }}>Home <b>> <u>Notice</u></b></p>
    </div>
  );
}
